	/**
	 * testValidCIMXMLRequests tests all valid CIM-XML requests contained in
	 * validCIMXMLRequests with each of the three parsers. Because the client
	 * does not parse normal requests (it will parse exported requests, a.k.a.
	 * indications), valid requests should result in some form of not-a-response
	 * exception.
	 * 
	 * @throws Exception
	 */
	public void testValidCIMXMLRequests() throws Exception {
		int fail = 0;
		if ((this.TEST_REQRSP & TEST_VALREQ) > 0) for (int i = 0; i < this.validCIMXMLRequests.length; i++) {
			String msg = this.validCIMXMLRequests[i];

			ByteArrayInputStream is = new ByteArrayInputStream(msg.getBytes());
			if ((this.TEST_PARSER & TEST_DOM) > 0) try {
				Common.parseWithDOM(is);
				printFailure("No expected exception", i, TEST_DOM, TEST_VALREQ, msg, null);
				fail++;
			} catch (Exception e) {
				if (this.DUMP_XCPT) printException(i, TEST_DOM, TEST_VALREQ, msg, e);
				if (!(e instanceof WBEMException)
						|| !"CIM message must be response!".equalsIgnoreCase(e.getMessage())) {
					printFailure("Unexpected exception", i, TEST_DOM, TEST_VALREQ, msg, e);
					fail++;
				} else if (this.VERBOSE) printSuccess(i, TEST_DOM, TEST_VALREQ, msg, e);
			}

			is.reset();
			if ((this.TEST_PARSER & TEST_PULL) > 0) try {
				CloseableIterator<Object> res = Common.parseWithPULL(is);
				while (res.hasNext())
					res.next();
				printFailure("No expected exception", i, TEST_PULL, TEST_VALREQ, msg, null);
				fail++;
			} catch (Exception e) {
				if (this.DUMP_XCPT) printException(i, TEST_PULL, TEST_VALREQ, msg, e);
				if (!(e.getCause() instanceof SAXException)
						|| (e.getCause() != null && !"Simple response child node expected for MESSAGE node!"
								.equalsIgnoreCase(e.getCause().getMessage()))) {
					printFailure("Unexpected exception", i, TEST_PULL, TEST_VALREQ, msg, e);
					fail++;
				} else if (this.VERBOSE) printSuccess(i, TEST_PULL, TEST_VALREQ, msg, e);
			}

			is.reset();
			if ((this.TEST_PARSER & TEST_SAX) > 0) try {
				Common.parseWithSAX(is);
				printFailure("No expected exception", i, TEST_SAX, TEST_VALREQ, msg, null);
				fail++;
			} catch (Exception e) {
				if (this.DUMP_XCPT) printException(i, TEST_SAX, TEST_VALREQ, msg, e);
				if (!(e instanceof WBEMException)
						|| !"Currently only AbstractSimpleRspNodes are handled!".equalsIgnoreCase(e
								.getMessage())) {
					printFailure("Unexpected exception", i, TEST_SAX, TEST_VALREQ, msg, e);
					fail++;
				} else if (this.VERBOSE) printSuccess(i, TEST_SAX, TEST_VALREQ, msg, e);
			}

			is.close();
		}
		verify("Valid CIM-XML request parsing failed " + fail + " times!", fail == 0);
	}

