	/**
	 * testInvalidCIMXMLRequests tests all invalid CIM-XML requests contained in
	 * invalidCIMXMLRequests with each of the three parsers. Invalid requests
	 * should result in some form of parsing exception.
	 * 
	 * @throws Exception
	 */
	public void testInvalidCIMXMLRequests() throws Exception {
		int fail = 0;
		if ((this.TEST_REQRSP & TEST_INVALREQ) > 0) for (int i = 0; i < this.invalidCIMXMLRequests.length; i++) {
			String msg = this.invalidCIMXMLRequests[i];

			ByteArrayInputStream is = new ByteArrayInputStream(msg.getBytes());
			if ((this.TEST_PARSER & TEST_DOM) > 0) try {
				Common.parseWithDOM(is);
				printFailure("No exception", i, TEST_DOM, TEST_INVALREQ, msg, null);
				fail++;
			} catch (Exception e) {
				if (this.DUMP_XCPT) printException(i, TEST_DOM, TEST_INVALREQ, msg, e);
				if (!(e.getCause() instanceof CIMXMLParseException)) {
					printFailure("Unexpected exception", i, TEST_DOM, TEST_INVALREQ, msg, e);
					fail++;
				} else if (this.VERBOSE) printSuccess(i, TEST_DOM, TEST_INVALREQ, msg, e);
			}

			is.reset();
			if ((this.TEST_PARSER & TEST_PULL) > 0) try {
				CloseableIterator<Object> res = Common.parseWithPULL(is);
				while (res.hasNext())
					res.next();
				printFailure("No exception", i, TEST_PULL, TEST_INVALREQ, msg, null);
				fail++;
			} catch (Exception e) {
				if (this.DUMP_XCPT) printException(i, TEST_PULL, TEST_INVALREQ, msg, e);
				if (!(e.getCause() instanceof SAXException)) {
					printFailure("Unexpected exception", i, TEST_PULL, TEST_INVALREQ, msg, e);
					fail++;
				} else if (this.VERBOSE) printSuccess(i, TEST_PULL, TEST_INVALREQ, msg, e);
			}

			is.reset();
			if ((this.TEST_PARSER & TEST_SAX) > 0) try {
				Common.parseWithSAX(is);
				printFailure("No exception", i, TEST_SAX, TEST_INVALREQ, msg, null);
				fail++;
			} catch (Exception e) {
				if (this.DUMP_XCPT) printException(i, TEST_SAX, TEST_INVALREQ, msg, e);
				if (!(e instanceof SAXException)) {
					printFailure("Unexpected exception", i, TEST_SAX, TEST_INVALREQ, msg, e);
					fail++;
				} else if (this.VERBOSE) printSuccess(i, TEST_SAX, TEST_INVALREQ, msg, e);
			}

			is.close();
		}
		verify("Invalid CIM-XML request parsing failed " + fail + " times!", fail == 0);
	}

