	/**
	 * testValidCIMXMLResponses tests all valid CIM-XML responses contained in
	 * validCIMXMLResponses with each of the three parsers. Valid responses
	 * should result in a successful return from parseWithXXX() with one
	 * exception: SAX parser and MULTIEXPRSP, as noted below.
	 * 
	 * @throws Exception
	 */
	public void testValidCIMXMLResponses() throws Exception {
		int fail = 0;
		if ((this.TEST_REQRSP & TEST_VALRSP) > 0) for (int i = 0; i < this.validCIMXMLResponses.length; i++) {
			String msg = this.validCIMXMLResponses[i];

			ByteArrayInputStream is = new ByteArrayInputStream(msg.getBytes());
			if ((this.TEST_PARSER & TEST_DOM) > 0) try {
				if (Common.parseWithDOM(is) == null) {
					printFailure("Null response", i, TEST_DOM, TEST_VALRSP, msg, null);
					fail++;
				} else if (this.VERBOSE) printSuccess(i, TEST_DOM, TEST_VALRSP, msg, null);
			} catch (Exception e) {
				if (this.DUMP_XCPT) printException(i, TEST_DOM, TEST_VALRSP, msg, e);
				printFailure("Unexpected exception", i, TEST_DOM, TEST_VALRSP, msg, e);
				fail++;
			}

			is.reset();
			if ((this.TEST_PARSER & TEST_PULL) > 0) try {
				if (Common.parseWithPULL(is) == null) {
					printFailure("Null response", i, TEST_PULL, TEST_VALRSP, msg, null);
					fail++;
				} else if (this.VERBOSE) printSuccess(i, TEST_PULL, TEST_VALRSP, msg, null);
			} catch (Exception e) {
				if (this.DUMP_XCPT) printException(i, TEST_PULL, TEST_VALRSP, msg, e);
				printFailure("Unexpected exception", i, TEST_PULL, TEST_VALRSP, msg, e);
				fail++;
			}

			is.reset();
			if ((this.TEST_PARSER & TEST_SAX) > 0) try {
				if (Common.parseWithSAX(is) == null) {
					printFailure("Null response", i, TEST_SAX, TEST_VALRSP, msg, null);
					fail++;
				} else if (this.VERBOSE) printSuccess(i, TEST_SAX, TEST_VALRSP, msg, null);
			} catch (Exception e) {
				if (this.DUMP_XCPT) printException(i, TEST_SAX, TEST_VALRSP, msg, e);

				// MULTI(EXP)RSP nodes cause the SAX parser to throw exception -
				// this is expected
				if (e instanceof WBEMException
						&& e.getMessage().contains(
								"Currently only AbstractSimpleRspNodes are handled")
						&& (this.validCIMXMLResponses[i].contains("MULTIEXPRSP") || this.validCIMXMLResponses[i]
								.contains("MULTIRSP"))) {
					if (this.VERBOSE) printSuccess(i, TEST_SAX, TEST_VALRSP, msg, e);
				} else {
					printFailure("Unexpected exception", i, TEST_SAX, TEST_VALRSP, msg, e);
					fail++;
				}
			}

			is.close();
		}
		verify("Valid CIM-XML response parsing failed " + fail + " times!", fail == 0);
	}

